import React from "react";
import {
  Line,
  LineChart,
  Tooltip,
  CartesianGrid,
  Legend,
  XAxis,
  YAxis,
  ResponsiveContainer
} from "recharts";

const data = [
  {
    date: "2020-02-17",
    AAPL: 4000,
    TSLA: 2400,
    amt: 2400
  },
  {
    date: "2020-02-18",
    AAPL: 3000,
    TSLA: 1398,
    amt: 2210
  },
  {
    date: "2020-02-19",
    AAPL: 2000,
    TSLA: 9800,
    amt: 2290
  },
  {
    date: "2020-02-20",
    AAPL: 2780,
    TSLA: 3908,
    amt: 2000
  },
  {
    date: "2020-02-21",
    AAPL: 1890,
    TSLA: 4800,
    amt: 2181
  },
  {
    date: "2020-02-22",
    AAPL: 2390,
    TSLA: 3800,
    amt: 2500
  },
  {
    date: "2020-02-23",
    AAPL: 3490,
    TSLA: 4300,
    amt: 2100
  },
  {
    date: "2020-02-24",
    AAPL: 4400,
    TSLA: 5000,
    amt: 2700
  },
  {
    date: "2020-02-25",
    AAPL: 5000,
    TSLA: 7600,
    amt: 2000
  },
  {
    date: "2020-02-26",
    AAPL: 6000,
    TSLA: 2500,
    amt: 2540
  },
  {
    date: "2020-02-27",
    AAPL: 8000,
    TSLA: 2600,
    amt: 2220
  }
];

class Dashchart extends React.Component {
  render() {
    return (
      <ResponsiveContainer width={700} height={100}>
        <LineChart
          // width={730}
          height={250}
          data={data}
          margin={{ top: 5, right: 30, left: 20, bottom: 5 }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="date" padding={{ left: 30, right: 30 }} />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="TSLA" stroke="#006fff" />
          <Line type="monotone" dataKey="AAPL" stroke="#1bd962" />
        </LineChart>
      </ResponsiveContainer>
    );
  }
}

export default Dashchart;
//ReactDOM.render(<Dashchart />, mountNode);
